contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

   constructor () internal {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit OwnershipTransferred(address(0), msgSender);
    }

   function owner() public view returns (address) {
        return _owner;
    }

   modifier onlyOwner() {
        require(isOwner(), "Ownable: caller is not the owner");
        _;
    }

    function isOwner() public view returns (bool) {
        return _msgSender() == _owner;
    }

    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        _transferOwnership(newOwner);
    }

    function _transferOwnership(address newOwner) internal virtual {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }    
}

contract TimeTable  is Ownable{
    
    using SafeMath for uint256;
    
    struct stage {
        
        uint16 yearStart;
        uint8 monthStart;
        uint8 dayStart;
       
        uint16 yearFinish;
        uint8 monthFinish;
        uint8 dayFinish;
       
        uint timestampSTART;
        uint timestampFINISH;
        
        uint _rate;
        uint weiRaisedOnStage;
        
        mapping(address => uint256) contributor;
        address[] contributors;
    }
        
    uint constant DAY_IN_SECONDS = 86400;
    uint constant YEAR_IN_SECONDS = 31536000;
    uint constant LEAP_YEAR_IN_SECONDS = 31622400;
 
    uint constant HOUR_IN_SECONDS = 3600;
    uint constant MINUTE_IN_SECONDS = 60;
 
    uint16 constant ORIGIN_YEAR = 1970;
    
    mapping (uint => stage) times;
    uint[] starts;
    bool _entrance = true;
    
    function _postValidatePurchase(address beneficiary, uint256 weiAmount) virtual internal {
        times[getCurrentStage()].contributor[beneficiary] = times[getCurrentStage()].contributor[beneficiary].add(weiAmount);
        times[getCurrentStage()].contributors.push(beneficiary);
    }
    
    function weiRaised() public view returns(uint){
        require(starts.length != 0, "TimedCrowdsale: there are no active processes right now"); 
        uint value = 0;
        for (uint i; i < starts.length; i = i + 1) {
            value = times[starts[i]].weiRaisedOnStage + value; 
        }
        return value;
    }
    
    function changeWeiRaised( uint weiAmount ) internal {
        times[getCurrentStage()].weiRaisedOnStage = times[getCurrentStage()].weiRaisedOnStage.add(weiAmount);
    } 
    
    function pushArray(uint8 _dayStart, uint8 _monthStart, uint16 _yearStart, uint8 _dayFinish, uint8 _monthFinish, uint16 _yearFinish, uint _timestampSTART, uint _timestampFINISH, uint rate) internal {
        times[_timestampSTART].yearStart = _yearStart;
        times[_timestampSTART].monthStart = _monthStart;
        times[_timestampSTART].dayStart = _dayStart;
        times[_timestampSTART].yearFinish = _yearFinish; 
        times[_timestampSTART].monthFinish = _monthFinish;
        times[_timestampSTART].dayFinish = _dayFinish;
        times[_timestampSTART].timestampSTART = _timestampSTART;
        times[_timestampSTART].timestampFINISH = _timestampFINISH;
        times[_timestampSTART]._rate = rate;
        starts.push(_timestampSTART);
    }
   
    function setTime(uint8 _dayStart, uint8 _monthStart, uint16 _yearStart, uint8 _dayFinish, uint8 _monthFinish, uint16 _yearFinish, uint rate) public onlyOwner {
        require(rate > 0, "TimedCrowdsale: rate cannot be NULL");
        uint _timestampSTART = inSec(_dayStart, _monthStart, _yearStart);
        require(_timestampSTART >= block.timestamp, "TimedCrowdsale: opening time is before current time");
        uint _timestampFINISH = inSec( _dayFinish, _monthFinish, _yearFinish);
        require(_timestampFINISH > _timestampSTART, "TimedCrowdsale: opening time is not before closing time");
        pushArray( _dayStart, _monthStart, _yearStart, _dayFinish, _monthFinish, _yearFinish, _timestampSTART, _timestampFINISH, rate);
    }
    
    function isLeapYear(uint16 year) internal pure returns (bool) {
        if (year % 4 != 0) {
            return false;
        }
        if (year % 100 != 0) {
            return true;
        }
        if (year % 400 != 0) {
            return false;
        }
        return true;
    }
   
    function inSec(uint8 day, uint8 month, uint16 year) internal pure returns (uint) {
        uint16 i;
        uint timestamp;
         // Year
        for (i = ORIGIN_YEAR; i < year; i++) {
            if (isLeapYear(i)) {
                timestamp += LEAP_YEAR_IN_SECONDS;
            }
            else {
                timestamp += YEAR_IN_SECONDS;
            }
        }
 
        // Month
        uint8[12] memory monthDayCounts;
        monthDayCounts[0] = 31;
        if (isLeapYear(year)) {
            monthDayCounts[1] = 29;
        }
        else {
            monthDayCounts[1] = 28;
        }
        monthDayCounts[2] = 31;
        monthDayCounts[3] = 30;
        monthDayCounts[4] = 31;
        monthDayCounts[5] = 30;
        monthDayCounts[6] = 31;
        monthDayCounts[7] = 31;
        monthDayCounts[8] = 30;
        monthDayCounts[9] = 31;
        monthDayCounts[10] = 30;
        monthDayCounts[11] = 31;
 
        for (i = 1; i < month; i++) {
            timestamp = timestamp.add(DAY_IN_SECONDS.mul(monthDayCounts[i - 1]));
        }
        // Day
        timestamp = timestamp.add(DAY_IN_SECONDS.mul(day - 1));
        return timestamp;
    }
    
    function getCurrentRate() public view time_stage returns(uint){
        return times[getCurrentStage()]._rate;
    }
    
    function getCurrentStage() internal view time_stage returns(uint) {
        for(uint i; i < starts.length; i = i + 1) {
            if(block.timestamp >= starts[i] && block.timestamp <= times[starts[i]].timestampFINISH){
                return starts[i];
            }
        }
    }
    
    modifier time_stage() {
        bool check = false;
        for(uint i; i < starts.length; i = i + 1) {
            if(block.timestamp >= starts[i] && block.timestamp <= times[starts[i]].timestampFINISH){
               check = true; 
            }
        }
        require(check, "TimedCrowdsale: there are no active processes right now");
        _;
    }
}

contract Stage is Ownable {
    using SafeMath for uint256; 
    
    struct stage{
        uint aim; // сумма, которая требуется на данном этапе
        uint rate; // курс
        uint weiRaisedOnStage; // сколько уже накопили
        
        mapping(address => uint) contributor; // инвесторы
        address[] contributors; // вклады
    }
    
    stage[] stages;
    
    function setStage(uint _aim, uint _rate) public onlyOwner checkLast {
        require(_aim != 0, "Stage: aim cannot be NULL");
        require(_rate != 0, "Stage: rate cannot be NULL");
        stage memory process; 
        process.aim = _aim;
        process.rate = _rate;
        stages.push(process);
    }     
    
    function aimIsReached(uint i) public view index(i) returns(bool) {
        if (stages[i].weiRaisedOnStage >= stages[i].aim) {
            return true;
        }
        else { return false; }
    }
    
    function rateForStage(uint i) public view index(i) returns(uint) {
        return stages[i].rate;
    }
    
    function getCurrentRate() public view time_stage returns(uint){
        return stages[stages.length.sub(1)].rate;
    }
    
    function getCurrentStage() internal view returns(uint){
        require(stages.length != 0, "stage: there are no processes "); 
        return stages.length-1;
    }
    
    function changeWeiRaised( uint weiAmount ) internal {
        stages[getCurrentStage()].weiRaisedOnStage = stages[getCurrentStage()].weiRaisedOnStage.add(weiAmount);
    } 
    
    function _postValidatePurchase(address beneficiary, uint256 weiAmount) virtual internal {
        stages[getCurrentStage()].contributor[beneficiary] = stages[getCurrentStage()].contributor[beneficiary].add(weiAmount);
        stages[getCurrentStage()].contributors.push(beneficiary);
    }

    function weiRaised() public view returns(uint){
        require(stages.length != 0, "stage: there are no active processes right now"); 
        uint value = 0;
        for (uint i; i < stages.length; i = i + 1) {
            value = stages[i].weiRaisedOnStage + value; 
        }
        return value;
    }

    modifier checkLast() {
        if(stages.length != 0) {
            require(aimIsReached(stages.length-1), "Stage: aim is not reached");
        }
        _;
    }

    modifier index(uint i) {
        require(stages.length != 0, "Stage: massive of stages is empty");
        require(i >= 0, "Stage: index cannot be negative number");
        require(i <= stages.length-1, "Stage: index cannot be greater than length of array");
        _;
    }    
    
    modifier time_stage() {
        if(stages.length != 0) {
            require(stages[stages.length.sub(1)].weiRaisedOnStage <= stages[stages.length.sub(1)].aim, "Stage: aim is reached");
        }
        _;
    }
}

contract SimpleToken_IERC20 is Context{
    using SafeMath for uint256;

    string public name;
    string public symbol;
    uint8 public decimals;
    uint public _totalSupply;

    mapping (address => uint256) private _balances; //колличество токенов у держателя 

    mapping (address => mapping (address => uint256)) private _allowances;
    
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor (uint totalSuply, string memory _symbol, string memory _name, uint8 _decimals) public {
        _mint(_msgSender(), totalSuply);
        symbol = _symbol;
        name = _name;
        decimals = _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply.sub(_balances[address(0)]);
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public virtual returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }
    
    function allowance(address owner, address spender) public view virtual returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 value) public virtual returns (bool) {
        _approve(_msgSender(), spender, value);
        return true;
    }
    
    function transferFrom(address sender, address recipient, uint256 amount) public virtual returns (bool) {
    	require(_allowances[sender][msg.sender] >= amount, "don`t have allowances");
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(msg.sender, spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
  	    require(_allowances[_msgSender()][spender] >= subtractedValue, "don`t have allowance");
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue));
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        
        _balances[sender] = _balances[sender].sub(amount);
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
    }

    function _approve(address owner, address spender, uint256 value) internal {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = value;
        emit Approval(owner, spender, value);
    }
    
    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
    }
    
    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        _balances[account] = _balances[account].sub(amount);
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, address(0), amount);
    }

    function _burnFrom(address account, uint256 amount) internal virtual {
        _burn(account, amount);
        _approve(account, _msgSender(), _allowances[account][_msgSender()].sub(amount));
    }
    
    function _beforeTokenTransfer(address from, address to, uint256 amount) internal virtual { }
}

contract Crowdsale is Stage, ReentrancyGuard {
    using SafeMath for uint256;

    SimpleToken_IERC20 private _token; 

    address payable private _wallet = payable(address(this));
    address payable private owners_wallet; 

    event ClaimedTokens(address indexed _token, address indexed _controller, uint _amount);

    event TokensPurchased(address indexed purchaser, address indexed beneficiary, uint256 value, uint256 amount);
    
    constructor(uint total_, string memory symbol, string memory name, uint8 decimals, address payable wallet) public{
        _token = new SimpleToken_IERC20(total_, symbol, name, decimals);
        owners_wallet = wallet;
    }
    
    receive() external payable  {
        buyTokens(_msgSender());
    }
    
    function get_ether(uint a) external onlyOwner {
        require(a <= address(this).balance, 'contract does not have enough ether');
        owners_wallet.transfer(a);
    }
      
    
    function totalSupply() public view returns(uint) {
        return _token.totalSupply(); 
    }
    
    function balanceOf(address account) public view returns(uint) {
        return _token.balanceOf(account);
    }
    
    function allowance(address owner, address spender) public view returns (uint256) {
        return _token.allowance(owner, spender);
    }

    function approve(address spender, uint256 value) public returns (bool) {
        return _token.approve(spender, value);
    }
    
    function increaseAllowance(address spender, uint256 addedValue) public returns (bool) {
        return _token.increaseAllowance(spender, addedValue); 
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public returns (bool) {
        return _token.decreaseAllowance(spender, subtractedValue);
    }
    
    function token() public view returns (SimpleToken_IERC20) {
        return _token;
    }

    function wallet() public view returns (address payable) {
        return _wallet;
    }
    
    function buyTokens(address beneficiary) public nonReentrant time_stage payable {//
        uint256 weiAmount;
        weiAmount = msg.value;
        
        _preValidatePurchase(beneficiary, weiAmount);

        uint256 tokens = _getTokenAmount(weiAmount);

        changeWeiRaised(weiAmount); 

        _processPurchase(beneficiary, tokens);
        _updatePurchasingState(beneficiary, weiAmount);
        emit TokensPurchased(_msgSender(), beneficiary, weiAmount, tokens);
        
        _forwardFunds();
        _postValidatePurchase(beneficiary, weiAmount);
    }
    
    function _postValidatePurchase(address beneficiary, uint256 weiAmount) override internal {
        super._postValidatePurchase(beneficiary, weiAmount);
    }
    
    function _preValidatePurchase(address beneficiary, uint256 weiAmount) internal view {
        require(beneficiary != address(0), "Crowdsale: beneficiary is the zero address");
        require(weiAmount != 0, "Crowdsale: weiAmount is 0");
        this;
    }

    function _updatePurchasingState(address beneficiary, uint256 weiAmount) internal {
     
    }
    
    function _deliverTokens(address beneficiary, uint256 tokenAmount) internal {
        _token.transfer(beneficiary, tokenAmount);
    }

    function _processPurchase(address beneficiary, uint256 tokenAmount) internal {
        _deliverTokens(beneficiary, tokenAmount);
    }

    function _getTokenAmount(uint256 weiAmount) internal view returns (uint) {
        return weiAmount.mul(getCurrentRate());
    }

    function _forwardFunds() internal {
        _wallet.transfer(msg.value);
    }
    
    /*
     @notice This method can be used by the owner to extract mistakenly
     sent tokens to this contract.
     @param _token The address of the token contract that you want to recover
     set to 0 in case you want to extract ether.
    */
    function claimTokens(address __token) public onlyOwner {
        if (__token == address(0x0)) {
            _wallet.transfer(address(this).balance); //перепроверить
            return;
        }

        SimpleToken_IERC20 token1 = SimpleToken_IERC20(__token);
        uint256 balance = token1.balanceOf(address(this));
        token1.transfer(owner(), balance);
        emit ClaimedTokens(__token, owner(), balance);
    }
    
}
